import "./App.css";
import Navbar from "./navbar.js";
import jump from "./Assets/jump.jpg"; // jumping image

function About() {
  return (
    <div>
      <header>
        <Navbar />
      </header>
      <body>
        {/* background image */}
        <div id="aboutBackground">
          <img
            id="aboutImg"
            src={jump}
            alt="Person jumping for joy over a couch and pillows"
          ></img>
        </div>
        {/* header text */}
        <div id="aboutText">
          <h3>All Products</h3>
          <p>
            All of our hand-made pillows come in your choice of four beautiful
            colors and three luxurious fills.
          </p>
        </div>
      </body>
    </div>
  );
}

export default About;
